<?php

namespace Tests;

use PHPUnit\Framework\TestCase;
use STAILEUAccounts\Avatar;

class Test extends TestCase
{

	private $base64 = "data:image/png;base64,";
	private $endpoint = "https://api.stail.eu/";
	private $uuid = "SA-58cea4341cf09";
	private $username = "lefuturiste";
	private $cSa = "c0714561-986a-4c70-a306-fbb305297e29";
	private $url = "http://localhost:4242";
	private $public = "29ccd923-8d62-465a-93bc-d4caa1969d87";
	private $private = "3cf36eba-0c91-4dbf-8546-27adc373ed41";

	public function STAILEUAccountBuilder()
	{
		return new \STAILEUAccounts\STAILEUAccounts($this->private, $this->public);
	}

	public function testUUID()
	{
		$this->assertEquals(
			$this->uuid,
			$this->STAILEUAccountBuilder()->getUUID($this->username)
		);
	}

	public function testUsername()
	{
		$this->assertEquals(
			$this->username,
			$this->STAILEUAccountBuilder()->getUsername($this->uuid)
		);
	}

	public function testAvatar()
	{
		$this->assertEquals(
			new Avatar($this->base64, $this->endpoint . "/avatar/image/" . $this->uuid),
			$this->STAILEUAccountBuilder()->getAvatar($this->uuid)
		);
	}

	public function testAvatarUrl()
	{
		$this->assertEquals(
			(new Avatar($this->base64, $this->endpoint . "/avatar/image/" . $this->uuid))->getUrl(),
			$this->STAILEUAccountBuilder()->getAvatar($this->uuid)->getUrl()
		);
	}

	public function testCheck()
	{
		$this->assertEquals(
			$this->uuid,
			$this->STAILEUAccountBuilder()->check($this->cSa)
		);
	}

	public function testGetUrl()
	{
		$this->assertEquals(
			"https://accounts.stail.eu/login?key=" . $this->public . "&redir=" . $this->url,
			$this->STAILEUAccountBuilder()->loginForm($this->url)
		);
	}
}
